SsaReportDefinitionServiceReportCompressType:
  type: string
  nullable: true
  enum:
  - NONE
  - UNKNOWN
  title: SsaReportDefinitionServiceReportCompressType
  description: |
    <div lang="ja">SsaReportDefinitionServiceReportCompressTypeは、定義されたダウンロードレポートの圧縮の有無を表します。<br>
    ADD時、このフィールドは省略可能となります。</div>
    <div lang="en">SsaReportDefinitionServiceReportCompressType displays if defined download report is compressed.<br>
    This field is optional in ADD operation.</div>
    <dl class=term>
      <dt class="term__item">NONE</dt>
      <dd class="term__desc"><span lang="ja">圧縮なしです。</span><span lang="en">Not compressed.</span></dd>
      <dt class="term__item">UNKNOWN</dt>
      <dd class="term__desc"><span lang="ja">未知の値です。</span><span lang="en">Unknown value.</span></dd>
    </dl>
